import { Route, Routes } from "react-router-dom"
import { HomePage } from "./HomePage"

export const MainApp = () => {
  return (
    <>
        <h1>Main App</h1>
        <hr/>

        <Routes>
            <Route path="/" element={ <HomePage /> } ></Route>
        </Routes>

    </>
  )
}
